import React from 'react';
import moment from 'moment';

const GoalPassFail = ({current: { name, duration, startDate, type, total, privacy, compId, tracker, completed, }}) => {

  let time = moment().startOf('day').diff(startDate, 'days') + 1;

  const table = () => {
    let list = [];
    for(let i = 1; i <= duration / 7; i++) {
      list.push(
        <span key={i}>
          Week {i}
          {buttons(i-1)}
        </span>);
    }
    return list;
  }

  const buttons = x => {
    let list = [];
    for(let i = 1; i <= total; i++) {
      list.push(
        <button 
          //onClick={} 
          key={x*total + i} 
          name={x*total + i} 
          value={true}
        >
          {value && <i className='fas fa-check'/>}
          {!value && <i className='fas fa-times'/>}
          {value === null && ' '}
        </button>
      )
    }
    return list;
  }

  return (
    <ul>
      <li>
        {table()}
      </li>
      <li>Start Date: </li>
      <li>Total: XX / {duration / 7 * total} (XX%)</li>
    </ul>
  )
}

export default GoalPassFail;
